      <Nav.Item>
        <LinkContainer to='/category/electronics'>
          <Nav.Link>Electronics</Nav.Link>
        </LinkContainer>
      </Nav.Item>
      {products.map((product) => (
              <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
               <LinkContainer to='/category/electronics'>
            return(
          <Nav.Link>product</Nav.Link>
          )
        </LinkContainer>

              </Col>
            ))}
      {/* add more categories as needed */}
    </Nav>
  );
};

